        <div className="myGrid">
          {this.state.boxes.map((items) => {
            return (
              <div className="gridLine" key={items.id}>
                {items.map((subItem) => {
                  return (
                    <div className="gridBox" b={subItem.border} key={subItem.id}>
                      {subItem.i}
